import hyderabadichicekbiryani from './Pages/hyderabadichickenbiryani.jpg'
const biryanis = [
    {
        name: "Hyderabadi Chicken Biryani",
        varients: ["full", "half"],
        prices: [
            {full: 300, half: 180}
        ],
        category: "non-veg",
        image: "https://example.com/hyderabadi-chicken-biryani.jpg",
        description: "Aromatic and flavorful chicken biryani from Hyderabad."
    },
    {
        name: "Vegetable Biryani",
        varients: ["full", "half"],
        prices: [
            {full: 250, half: 150}
        ],
        category: "veg",
        image: "https://example.com/vegetable-biryani.jpg",
        description: "A delicious mix of vegetables and spices cooked with basmati rice."
    },
    {
        name: "Lucknowi Mutton Biryani",
        varients: ["full", "half"],
    prices: [
            {full: 350, half: 200}
        ],
        category: "non-veg",
        image: "https://example.com/lucknowi-mutton-biryani.jpg",
        description: "A rich and aromatic mutton biryani from Lucknow."
    }
];

export default biryanis;
